import React from "react";
import "./our-member.css";
import { Link } from "react-router-dom";
import ava01 from "./cars-img/bmw-offer.png";
import ava02 from "./cars-img/mercedes-offer.png";
import ava03 from "./cars-img/nissan-offer.png";
import img from "./cars-img/nissan-offer.png";
import carData from "./carData";


import Back from "../common/Back";

const OUR__MEMBERS = [
  {
    name: "Jhon Doe",
    experience: "5 years of experience",
    fbUrl: "#",
    instUrl: "#",
    twitUrl: "#",
    linkedinUrl: "#",
    imgUrl: ava01,
  },

  {
    name: "David Lisa",
    experience: "5 years of experience",
    fbUrl: "#",
    instUrl: "#",
    twitUrl: "#",
    linkedinUrl: "#",
    imgUrl: ava02,
  },

  {
    name: "Hilton King",
    experience: "5 years of experience",
    fbUrl: "#",
    instUrl: "#",
    twitUrl: "#",
    linkedinUrl: "#",
    imgUrl: ava03,
  },

  {
    name: "Jhon Doe",
    experience: "5 years of experience",
    fbUrl: "#",
    instUrl: "#",
    twitUrl: "#",
    linkedinUrl: "#",
    imgUrl: ava01,
  },
];

const Cars = () => {
  return (
    <div className='content grid5 mtop'>
    <Back name='About Us' title='About Us - Who We Are?' cover={img} />
      {carData.map((item, index) => (
        <div lg="3" md="3" sm="4" xs="6" key={index} className="mb-4">
          <div className="single__member">
            <div className="single__member-img">
              <img src={item.imgUrl} alt="" className="w-100" />
            </div>
            <div className="name">
              <h1>{item.carName}</h1>
              <p>{item.price}</p>
            </div>


            <h6 className="text-center mb-0 mt-3">{item.name}</h6>
            <p className="section__description text-center">
              {item.experience}
            </p>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Cars;
